import React from "react";
import "./partners.css";
import intraEdge from "./images/intraEdge.png";
import { motion } from "framer-motion";
import AppAnimations from "../../../../common/js/animations";
export default class Partners extends React.Component {
  render() {
    return (
      <section className="section">
        <div className="partnersHeading">Our Partners</div>
        <div className="partnersHeadingSeperator"></div>
        <motion.div
          variants={AppAnimations.slideToTop}
          initial="hidden"
          whileInView="visible"
          className="partnerLogos"
        >
          <div className="partnerLogo">
            <img src={intraEdge}></img>
          </div>
          <div className="partnerLogo">
            <img src={intraEdge}></img>
          </div>
          <div className="partnerLogo">
            <img src={intraEdge}></img>
          </div>
          <div className="partnerLogo">
            <img src={intraEdge}></img>
          </div>
          <div className="partnerLogo">
            <img src={intraEdge}></img>
          </div>
        </motion.div>
      </section>
    );
  }
}
